import {React,useState } from 'react'
import { useNavigate } from 'react-router-dom'
import PracSer from './PracSer';

function Prac() {
    
    let navigate=useNavigate();


    const [emp,setEmp]=useState({
        currentMarketValue:"",
        carpetArea:"",
        pincode:"",
        buildingAge:"",
        propertyEffect:"",
        security24x7:"",
        isSalaried:""
    })
    var cancelHandeler=(e)=>{
        navigate("/home");
    }
    const handleClick=(e)=>{
        const currentMarketValue=e.target.currentMarketValue;
        const carpetArea=e.target.carpetArea;
        const pincode=e.target.pincode;
        const buildingAge=e.target.buildingAge;
        const propertyEffect=e.target.propertyEffect;
        const security24x7=e.target.security24x7;
        const isSalaried=e.target.isSalaried;
        setEmp({... emp,[name]:value});
    }
    const saveHandler=(e)=>{
        e.preventDefault();
     console.log("emp=>"+JSON.stringify(emp));
     PracSer.C   
    }

  return (
    <div className='container mt-3'>
      <div className='row'>
        <div className='card col-md-6 oddset-md-3'>
            <h3 className='text-center'>input</h3>
            <div className='card-body'>
                <form>
                    <div className='form group'>
                        <label>currentMarketValue</label>
                        <input type='text' name='currentMarketValue' className='form-control' placeholder='currentMarketValue' value={emp.currentMarketValue} onChange={handleClick}/>

                    </div>

                    
                    <div className='form group'>
                        <label>carpetArea</label>
                        <input type='text' name='carpetArea' className='form-control' placeholder='carpetArea' value={emp.carpetArea} onChange={handleClick}/>

                    </div>

                    <div className='form group'>
                        <label>buildingAge</label>
                        <input type='text' name='buildingAge' className='form-control' placeholder='buildingAge' value={emp.carpetArea} onChange={handleClick}/>

                    </div>

                    <div className='form group'>
                        <label>pincode</label>
                        <input type='text' name='pincode' className='form-control' placeholder='pincode' value={emp.pincode} onChange={handleClick}/>

                    </div>

                    <div className='form group'>
                        <label>propertyEffect</label>
                        <input type='text' name='propertyEffect' className='form-control' placeholder='propertyEffect' value={emp.propertyEffect} onChange={handleClick}/>

                    </div>

                    <div className='form group'>
                        <label>security24x7</label>
                        <input type='text' name='security24x7' className='form-control' placeholder='security24x7' value={emp.security24x7} onChange={handleClick}/>

                    </div>

                    <div className='form group'>
                        <label>isSalaried</label>
                        <input type='text' name='isSalaried' className='form-control' placeholder='isSalaried' value={emp.isSalaried} onChange={handleClick}/>

                    </div>

                    <button className='btn btn-success' onClick={saveHandler}>save</button>
                    <button className='btn btn-danger' onClick={cancelHandeler}>cancel</button>

                </form>
            </div>
        </div>
      </div>
    </div>
  )
}

export default Prac
